const initialState ={
    datauser:[],
    dataweboption:[]
}
export default (state = initialState, action) => {
    switch (action.type){
        case 'userlogin':
        return Object.assign({}, state , {
            datauser: action.datauser
        })

        case 'weboption':
        return Object.assign({}, state , {
            dataweboption: action.dataweboption
        })

        default :
        return state
        
    }
}
